import React from 'react';
import { Link } from 'react-router-dom';
import {HeaderTop} from './HeaderTop.js';
import { login } from './login.js';
import {
  BrowserRouter as Router,
  Switch,
  Route} from "react-router-dom"; 

export function App(props) {
  return (
      <Router>
        <div>
          <Switch>
            <Route exact path="/">
              <HeaderTop />
            </Route>
            <Route path="/login">
              <login />
            </Route>
          </Switch>
        </div>
      </Router>

  );
}
